import React from "react";
import flowers from "../../flowerslist/flowersList";

export const FlowerCartSummary = () => {
  return (
    <section className="Flowers__Cart__PositionContainer">
      <img src={flowers.find((it) => it.id === 1).img_src} alt="" />
      <article>
        {flowers.find((it) => it.id === 1).name}
        <div className="Flowers__Cart__PositionContainer--Info">
          <span>{flowers.find((it) => it.id === 1).options.option_2}</span>
          <span>{flowers.find((it) => it.id === 1).prise.option_2}$</span>
        </div>
      </article>

      <div className="Flowers__Cart__PositionContainer--CloseButton"></div>
    </section>
  );
};
